    public static function getCountriesByCode()
    {
        $countries = [];
        foreach (self::$countries as $country) {
            $countries[$country[1]] = $country[0];
        }
        return $countries;
    }
    public static function getStatesForCountryCode($code)
    {
        foreach (self::$countries as $country) {
            if ($country[1] == $code) {
                $return = [];
                $states = explode("|", $country[2]);
                foreach ($states as $state) {
                    $return[$state] = $state;
                }
                return $return;
            }
        }
        return NULL;
    }
    public static function getStatesWithCountryCode()
    {
        $returnCountry = [];
        foreach (self::$countries as $country) {
            $countryCode = $country[1];
            $states = [];
            if (!empty($country[2])) {
                $states = explode("|", $country[2]);
            }
            $returnCountry[$countryCode] = $states;
        }
        return $returnCountry;
    }
